import React from 'react'
import Tabs from './tabs'
import './xyzw.css'

const Practice = () => {

  const tabsContent = [
    {
      label:'Tab 1',
      content:<div>this is Tab 1</div>
    },
    {
      label:'Tab 2',
      content:<div>this is Tab 2</div>
    },
    {
      label:'Tab 3',
      content:<div>this is Tab 3</div>
    },
  ]

  return <Tabs tabsContent={tabsContent} />
}

export default Practice
